import React, { Component } from 'react';

class App extends Component {
    render() {
        return (
            <div class='container'>
                <h1 className='title'>Seinfeld Quiz</h1>
                <h2 className='subtitle'>giddy up</h2>
            </div>
        );
    }
}

export default App;
